export class Cas{
  predmet : string = "";
  nastavnik : string = "";
  ucenik : string = "";
  opis : string = "";
  datumvreme : Date = new Date();
  datumvremekraj : Date = new Date();
  odrzan : number = 0;
  komentar : string = "";
  potvrdjen : number = 0;
  ocena : number = 0;
  potvrdaObavestenje : number = 0
  otkazObavestenj : number = 0



  avgOcena : number = 0
  name : string = ""
  surname : string = ""
  hidden : number = 1
  startDisplayTime : Date = new Date()
  endDisplayTime : Date = new Date()
  isduble : number = 0
}
